  sea surface temperature, and surface atmospheric pressure, air temperature, compass,
  surface PAR, salinity, surface UVB, subsurface PAR, and subsurface UVB, Direction
  component wind velocity U/V; for the surrounding coral reef ecosystem. Data telemetry
  also serves to alert researchers to the potential of imminent or ongoing coral reef
  bleaching or other natural events (hurricanes, storm damage, cooling, etc.) so that
